script: |
  super -f text -I q6143.spq | sort > q6143.out

inputs:
  - name: q6143.spq
    data: |
      SELECT DISTINCT + 30 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT ( NULL ) IS NOT NULL;
  - name: tab0
  - name: tab2

outputs:
  - name: q6143.out
    data: |
      30
